import {combineReducers} from "redux";

import stateTable from "../serverViewType/reducers/reducerViewType";
import WindowCreateNewData from "../windowCreateNewData/reducers/reducerWindowCreateNewData";
import stateTable_EltypeClasse from '../EltypeClasse/reducers/reducerEltypeClasse';

const rootReducer = combineReducers({
    stateTable,
    WindowCreateNewData,
    stateTable_EltypeClasse
})

export default rootReducer
